import React from "react"
import logo from '../react-logo.png';

export default function Navbar(){

    const handleInputButton = () =>{
        console.log("Clicked");
    }
    const handleResultsButton = () =>{
        console.log("Clicked");
    }
    const handleExplanationButton = () =>{
        console.log("Clicked");
    }

    return(
        <nav className = "nav">
            <img className = "nav-logo" src={logo}></img>
            <h3 className = "nav-logo_text">Escitalopram Remission Predictor</h3>
            <ul className = "nav-buttons">
                <button onClick={handleInputButton}>Input</button>
                <button onClick={handleResultsButton}>Results</button>
                <button onClick={handleExplanationButton}>Why?</button>
            </ul>
            
        </nav>
    );
}
